import React from "react";

const Navigation = () => {
  return (
    <nav>
      <div className="logo"></div>

      <div>
        <ul>
          <li>Home</li>
          <li>Menu</li>
          <li>Our Story</li>
          <li>Contact us</li>
        </ul>
      </div>
    </nav>
  );
};

export default Navigation;
